			{ Languages.PortuguesePortugal.ToCultureInfo(), "Se você planeja usar Optikey com o tracker olho Irisbond Duo, por favor, certifique-se de ter os drivers Irisbond Duo instalados. Estes podem ser descarregados a partir https://www.irisbond.com/en/producto/irisbond-duo-2." },
			{ Languages.RussianRussia.ToCultureInfo(), "Если вы планируете использовать Optikey с глазами трекера Irisbond Duo, пожалуйста, убедитесь, что у вас есть драйвера Irisbond Duo установлен. Они могут быть загружены с https://www.irisbond.com/en/producto/irisbond-duo-2." },
			{ Languages.SerbianSerbia.ToCultureInfo(), "Ако планирате да користите Optikey са Ирисбонд Дуо ока трагач онда пазите да имате Ирисбонд Дуо управљачке програме инсталиране. Они се могу преузети са хттпс://ввв.ирисбонд.цом/продуцтс/довнлоадс." },
			{ Languages.SlovakSlovakia.ToCultureInfo(), "Ak máte v pláne používať Optikey s očné tracker Irisbond Duo, potom si prosím skontrolujte, či máte k dispozícii ovládače Irisbond Duo nainštalované. " },
			{ Languages.SlovenianSlovenia.ToCultureInfo(), "Če nameravate uporabljati Optikey z oči tracker Irisbond Duo potem se prepričajte, da imate gonilnike Irisbond Duo namestili. Te lahko prenesete s https://www.irisbond.com/en/producto/irisbond-duo-2." },
			{ Languages.SpanishSpain.ToCultureInfo(), "Si va a utilizar Optikey con el rastreador ocular Irisbond Duo, por favor asegúrese de que tiene los controladores instalados Irisbond Duo. Estos se pueden descargar desde https://www.irisbond.com/en/producto/irisbond-duo-2." },
			{ Languages.TurkishTurkey.ToCultureInfo(), "Eğer Irisbond Duo göz izleme ile Optikey kullanmayı planlıyorsanız o zaman yüklü Irisbond Duo sürücüleri olduğundan emin olun. Bu https://www.irisbond.com/en/producto/irisbond-duo-2 indirilebilir." },
			{ Languages.UkrainianUkraine.ToCultureInfo(), "Якщо ви плануєте використовувати Optikey з очима трекера Irisbond Duo, будь ласка, переконайтеся, що у вас є драйвера Irisbond Duo встановлений. Вони можуть бути завантажені з https://www.irisbond.com/en/producto/irisbond-duo-2." },
			{ Languages.UrduPakistan.ToCultureInfo(), "آپ Irisbond جوڑی آنکھ ٹریکر کے ساتھ Optikey استعمال کرنے کا ارادہ ہو تو براہ مہربانی آپ Irisbond جوڑی ڈرائیوروں نصب ہے براہ کرم یقینی بنائیں. یہ https://www.irisbond.com/en/producto/irisbond-duo-2 سے ڈاؤن لوڈ کیا جا سکتا ہے." },
		};
