		public static Dictionary<CultureInfo, string> MOUSE_POSITION_INFO = new Dictionary<CultureInfo, string>()
		{
			{ Languages.CatalanSpain.ToCultureInfo(), "En aquesta manera, Optikey farà servir el cursor del ratolí com a entrada en lloc de parlar directament a un seguidor d'ulls. És possible que vulgueu això si s'està provant Optikey a terme, o desitja utilitzar-lo amb un dispositiu d'entrada alternatiu, com un ratolí de cap o qualsevol rastrejador ocular no en aquesta llista. " },
			{ Languages.CroatianCroatia.ToCultureInfo(), "U ovom načinu rada, Optikey će koristiti pokazivač miša kao ulaz umjesto da govori izravno na oku tracker. Možda želite to ako ste Optikey testiranje, ili ako želite koristiti ga s alternativnim ulaznog uređaja, kao što je glava miša ili bilo kojeg oka tracker nije na popisu." },
			{ Languages.CzechCzechRepublic.ToCultureInfo(), "V tomto režimu bude Optikey použijte kurzor myši jako vstup namísto mluvení přímo do očí tracker. Možná budete chtít to, pokud testujete Optikey ven, nebo chcete-li použít alternativní vstupní zařízení, jako je například hlava myši nebo jakékoliv oční tracker není v tomto seznamu. Pro více informací viz www.optikey.org/help" },
			{ Languages.DanishDenmark.ToCultureInfo(), "I denne tilstand vil Optikey bruge musemarkøren som input i stedet for at tale direkte til et øje tracker. Du vil måske dette, hvis du tester Optikey ud, eller hvis du ønsker at bruge den med en alternativ indgang enhed, såsom et hoved mus eller en hvilken som helst øje tracker ikke på denne liste. " },
			{ Languages.DutchBelgium.ToCultureInfo(), "In deze modus zal Optikey de muiscursor als input gebruiken in plaats van rechtstreeks in gesprek met een eye tracker. Je zou dit wilt als je Optikey bent het testen van, of als u het wilt gebruiken met een alternatief invoerapparaat, zoals een kop muis of een eye tracker niet in deze lijst. " },
			{ Languages.DutchNetherlands.ToCultureInfo(), "In deze modus zal Optikey de muiscursor als input gebruiken in plaats van rechtstreeks in gesprek met een eye tracker. Je zou dit wilt als je Optikey bent het testen van, of als u het wilt gebruiken met een alternatief invoerapparaat, zoals een kop muis of een eye tracker niet in deze lijst. " },
			{ Languages.EnglishCanada.ToCultureInfo(), "In this mode, Optikey will use the mouse cursor as input instead of talking directly to an eye tracker. You might want this if you're testing Optikey out, or if you want to use it with an alternative input device such as a head mouse or any eye tracker not in this list." },
			{ Languages.EnglishUK.ToCultureInfo(), "In this mode, Optikey will use the mouse cursor as input instead of talking directly to an eye tracker. You might want this if you're testing Optikey out, or if you want to use it with an alternative input device such as a head mouse or any eye tracker not in this list." },
			{ Languages.EnglishUS.ToCultureInfo(), "In this mode, Optikey will use the mouse cursor as input instead of talking directly to an eye tracker. You might want this if you're testing Optikey out, or if you want to use it with an alternative input device such as a head mouse or any eye tracker not in this list." },
			{ Languages.FinnishFinland.ToCultureInfo(), "Tässä tilassa Optikey käyttää hiiren kursori syötteenä puhumisen sijasta suoraan silmänseurain. Haluat ehkä tämä Jos testaat Optikey pois, tai jos haluat käyttää sitä vaihtoehtoista raaka laite, kuten pään hiiren tai silmänseurain ole luettelossa. " },
			{ Languages.FrenchCanada.ToCultureInfo(), "Dans ce mode, Optikey utilisera le curseur de la souris comme entrée au lieu de parler directement à un oculomètre. Vous voudrez peut-être si vous testez Optikey, ou si vous voulez l'utiliser avec un dispositif d'entrée alternative comme une souris de tête ou tout oculomètre pas dans cette liste. " },
			{ Languages.FrenchFrance.ToCultureInfo(), "Dans ce mode, Optikey utilisera le curseur de la souris comme entrée au lieu de parler directement à un oculomètre. Vous voudrez peut-être si vous testez Optikey, ou si vous voulez l'utiliser avec un dispositif d'entrée alternative comme une souris de tête ou tout oculomètre pas dans cette liste. " },
			{ Languages.GeorgianGeorgia.ToCultureInfo(), "ამ რეჟიმში, Optikey გამოიყენოთ მაუსის კურსორი შეტანის ლაპარაკის ნაცვლად პირდაპირ თვალის ისტორიაზე. დაგვჭირდება, თუ თქვენ ტესტირების Optikey out, ან თუ გსურთ გამოიყენოთ ეს ალტერნატივა შეტანის მოწყობილობა როგორიცაა ხელმძღვანელი მაუსის ან თვალის tracker არა ამ სიაში. " },
			{ Languages.GermanGermany.ToCultureInfo(), "Auf diese Weise, wird Optikey den Mauszeiger benutzen, anstadt das Signal eines Eye-Trackers zu verwenden. Sie können diese Funkzionsweise zum Testen von Optikey gebrauchen oder wenn sie einen Ersatzlösung brauchen für Geräte wie eine Kopfgesteuertemaus oder einen Eye-Tracker der nicht aufgelistet ist." },
			{ Languages.GreekGreece.ToCultureInfo(), "Σε αυτή τη λειτουργία, Optikey θα χρησιμοποιήσει το δείκτη του ποντικιού ως είσοδο αντί να μιλάμε απευθείας σε ένα ιχνηλάτη οφθαλμού. Μπορεί να θέλετε αυτό, αν είστε δοκιμές Optikey έξω, ή αν θέλετε να το χρησιμοποιήσετε με μια εναλλακτική συσκευή εισόδου, όπως ένα ποντίκι κεφαλής ή όχι κάθε ιχνηλάτη ματιών σε αυτή τη λίστα. " },
			{ Languages.HebrewIsrael.ToCultureInfo(), "במצב זה, Optikey ישתמש סמן העכבר כקלט במקום לדבר ישירות גשש העין. אולי אתה רוצה את זה אם אתה בודק את Optikey, או אם אתה רוצה להשתמש בו עם מכשיר קלט חלופי כגון עכבר ראש או גשש כל עין לא ברשימה זו." },
			{ Languages.HindiIndia.ToCultureInfo(), "इस मोड में, Optikey माउस कर्सर को आई ट्रैकर से सीधे बात करने के बजाय इनपुट के रूप में उपयोग करेगा। यदि आप Optikey का परीक्षण कर रहे हैं, या यदि आप इसे वैकल्पिक इनपुट डिवाइस जैसे हेड माउस या किसी आई ट्रैकर के साथ प्रयोग करना चाहते हैं, तो आप यह नहीं चाह सकते हैं।" },
			{ Languages.HungarianHungary.ToCultureInfo(), "Ebben az üzemmódban Optikey fogja használni a kurzort a beviteli helyett beszél közvetlenül az szemkövetővel. Érdemes ezt, ha tesztelés Optikey ki, vagy ha szeretné használni egy alternatív beviteli eszköz, például egy fej egér vagy szemkövetővel nem szerepel a listában." },
			{ Languages.ItalianItaly.ToCultureInfo(), "In questa modalità Optikey userà il puntatore del mouse come input invece di usare il segnale di un dispositivo di tracciamento oculare. Puoi usare questa modalità per testare Optikey oppure se vuoi usare Optikey con un dispositivo alternativo tipo un mouse controllabile dalla testa o un dispositivo di tracciamento oculare non presente in questa lista." },
			{ Languages.JapaneseJapan.ToCultureInfo(), "このモードでは、Optikeyはアイトラッカーに直接話すのではなく、入力として、マウスカーソルを使用します。あなたがOptikeyをテストしている場合は、これをお勧めします、またはあなたは、このようなヘッドマウスなどの代替入力デバイス、または任意のアイトラッカーではない、このリストには、それを使用したい場合。" },
			{ Languages.KoreanKorea.ToCultureInfo(), "이 모드에서, Optikey는 눈 추적기에 직접 말하는 대신 입력으로 마우스 커서를 사용합니다. 당신은 당신이 Optikey을 테스트하는 경우이 원하는, 또는 수 당신은 머리 마우스 또는이 목록에없는 어떤 눈 추적 장치 같은 대체 입력 장치와 함께 사용하려는 경우. " },
			{ Languages.PersianIran.ToCultureInfo(), "در این حالت، Optikey ماوس را به عنوان ورودی به جای صحبت کردن به طور مستقیم به یک ردیاب چشم استفاده کنید. شما ممکن است این می خواهید اگر شما در حال آزمایش Optikey کردن، و یا اگر شما می خواهید به استفاده از آن با یک دستگاه ورودی های جایگزین مانند یک موش سر و یا هر ردیاب چشم در این لیست است. " },
			{ Languages.PolishPoland.ToCultureInfo(), "W tym trybie będzie Optikey użyć kursora myszy jako wejście zamiast mówić bezpośrednio do śledzenia oczu. Może chcesz to jeśli testujesz Optikey się, lub jeśli chcesz używać go z alternatywnego urządzenia wejściowego, takich jak mysz głowy ani nie tracker oko w tej liście. " },
			{ Languages.PortuguesePortugal.ToCultureInfo(), "Neste modo, Optikey vai usar o cursor do mouse como entrada em vez de falar diretamente a um rastreador ocular. Você pode querer isso, se você está testando Optikey para fora, ou se você quiser usá-lo com um dispositivo de entrada alternativo, como um mouse de cabeça ou não qualquer rastreador olho nesta lista. Para mais informações, consulte www.optikey.org/help" },
			{ Languages.RussianRussia.ToCultureInfo(), "В этом режиме, Optikey будет использовать курсор мыши в качестве входных данных, вместо того, чтобы говорить непосредственно с трекером глаз. Вы можете захотеть этого, если вы тестируете Optikey вне, или если вы хотите использовать его с альтернативным устройством ввода, такие как головки мыши или любой глаз трекер не в этом списке. " },
			{ Languages.SerbianSerbia.ToCultureInfo(), "У овом режиму, Optikey ће користити курсор миша као улаз уместо да говоримо директно на тракер ока. Можда ћете желети ово ако Optikey тестира, или ако желите да га користите са алтернативним улазног уређаја као што су миш главе или било трагач ока није на овој листи. " },
			{ Languages.SlovakSlovakia.ToCultureInfo(), "V tomto režime bude Optikey použite kurzor myši ako vstup namiesto rozprávanie priamo do očí tracker. Možno budete chcieť to, ak testujete Optikey von, alebo ak chcete použiť alternatívne vstupné zariadenia, ako je napríklad hlava myši alebo akékoľvek očné tracker nie je v tomto zozname. " },
			{ Languages.SlovenianSlovenia.ToCultureInfo(), "V tem načinu bo Optikey uporabite miško kot vhod, namesto da bi govoril neposredno v sledilnik oči. Morda boste to želeli, če ste testiranje Optikey ven, ali če želite, da ga uporabljate z alternativnim vhodne naprave, kot so glave miško ali katere koli oči tracker ni na tem seznamu. " },
			{ Languages.SpanishSpain.ToCultureInfo(), "En este modo, Optikey utilizará el cursor del ratón como entrada en lugar de hablar directamente a un seguidor de ojos. Es posible que desee esto si se está probando Optikey a cabo, o si desea utilizarlo con un dispositivo de entrada alternativo, como un ratón de cabeza o cualquier rastreador ocular no en esta lista. " },
			{ Languages.TurkishTurkey.ToCultureInfo(), "Bu modda, Optikey bir göz izleme doğrudan konuşmak yerine girdi olarak fare imlecini kullanacaktır. Sen Optikey test ediyoruz eğer bunu istiyorum olabilecek veya böyle bir kafa fare veya bu listede herhangi bir göz izleme gibi alternatif bir giriş cihazı ile kullanmak istiyorum. Daha fazla bilgi için, bkz www.optikey.org/help" },
			{ Languages.UkrainianUkraine.ToCultureInfo(), "У цьому режимі, Optikey буде використовувати курсор миші в якості вхідних даних, замість того, щоб говорити безпосередньо з трекером очей. Ви можете захотіти цього, якщо ви тестируете Optikey поза, або якщо ви хочете використовувати його з альтернативним пристроєм введення, такі як головки миші або будь-який очей трекер не в цьому списку." },
			{ Languages.UrduPakistan.ToCultureInfo(), "اس موڈ میں، Optikey ایک آنکھ ٹریکر سے براہ راست بات کرنے کی بجائے ان پٹ کے طور پر ماؤس کرسر کا استعمال کریں گے. تم یہ چاہتے ہو سکتا ہے آپ Optikey باہر کی جانچ کر رہے ہیں، یا اگر آپ اس طرح کے طور پر ایک سر ماؤس یا کسی بھی آنکھ کی اس فہرست میں نہیں ٹریکر ایک متبادل ان پٹ ڈیوائس کے ساتھ اس کا استعمال کرنا چاہتے ہیں." },
		};
