		public static Dictionary<CultureInfo, string> TOBII_ASSISTIVE_INFO = new Dictionary<CultureInfo, string>()
		{
			{ Languages.CatalanSpain.ToCultureInfo(), "Per utilitzar Optikey amb un rastrejador ocular d'assistència, ja sigui que necessita la nova versió de Tobii Windows Control, o el motor de Tobii Eye Tracking. Si cal utilitzar la versió antiga de l'aplicació Tobii Windows Control (Tobii Gaze Interaction Software), aleshores us farà falta per controlar Optikey utilitzant la posició del ratolí en lloc. " },
			{ Languages.CroatianCroatia.ToCultureInfo(), "Za korištenje Optikey s pomoćnim oka Tracker Tobii, bilo je potrebno novu verziju Tobii Windows Control, odnosno motor Tobii očiju praćenje. Ako trebate koristiti staru verziju upravljačkog primjene Tobii Windows Control (Tobii Gaze Interaction Software), onda ćete morati kontrolirati Optikey pomoću položaja miša umjesto." },
			{ Languages.CzechCzechRepublic.ToCultureInfo(), "Chcete-li používat Optikey s asistenční očí tracker, musíte buď novou verzi systému Windows Control, nebo motoru Tobii Eye Tracking. Pokud potřebujete použít starou verzi ovládacího aplikace Tobii Windows Control (Tobii Gaze Interaction Software), pak se budete muset řídit Optikey pomocí pozici myši místo. Pro více informací viz www.optikey.org/help" },
			{ Languages.DanishDenmark.ToCultureInfo(), "For at bruge Optikey med et hjælpemiddel øje tracker, du enten har brug for den nye version af Windows Control eller Tobii Eye Tracking motor. Hvis du skal bruge den gamle version af Tobii Windows Control ansøgning (Tobii Gaze Interaction Software), så bliver du nødt til at kontrollere Optikey ved hjælp af musen position i stedet. " },
			{ Languages.DutchBelgium.ToCultureInfo(), "Om gebruik te maken Optikey met een ondersteunende eye tracker, moet u ofwel de nieuwe versie van Tobii Windows Control, of de Tobii Eye Tracking motor nodig. Als u de oude versie van de Tobii Windows Control toepassing (Tobii Gaze Interaction Software) gebruikt, dan zul je nodig hebt om te controleren Optikey met de muis positie plaats. " },
			{ Languages.DutchNetherlands.ToCultureInfo(), "Om gebruik te maken Optikey met een ondersteunende eye tracker, moet u ofwel de nieuwe versie van Tobii Windows Control, of de Tobii Eye Tracking motor nodig. Als u de oude versie van de Tobii Windows Control toepassing (Tobii Gaze Interaction Software) gebruikt, dan zul je nodig hebt om te controleren Optikey met de muis positie plaats. " },
			{ Languages.EnglishCanada.ToCultureInfo(), "To use Optikey with an assistive eye tracker, you either need the new version of Windows Control, or the Tobii Eye Tracking engine. If you need to use the old version of the Tobii Windows control application (including Tobii Gaze Interaction settings), then you will need to control Optikey using mouse position instead." },
			{ Languages.EnglishUK.ToCultureInfo(), "To use Optikey with an assistive eye tracker, you either need the new version of Windows Control, or the Tobii Eye Tracking engine. If you need to use the old version of the Tobii Windows control application (including Tobii Gaze Interaction settings), then you will need to control Optikey using mouse position instead." },
			{ Languages.EnglishUS.ToCultureInfo(), "To use Optikey with an assistive eye tracker, you either need the new version of Windows Control, or the Tobii Eye Tracking engine. If you need to use the old version of the Tobii Windows control application (including Tobii Gaze Interaction settings), then you will need to control Optikey using mouse position instead." },
			{ Languages.FinnishFinland.ToCultureInfo(), "Käyttää Optikey kanssa avustavien silmänseurain, sinun täytyy joko uuden Tobii Windows Control tai Tobii Eye Tracking moottori. Jos joudut käyttämään vanhaa versiota Tobii Windows Control (Tobii Gaze Interaction Software), sinun täytyy valvoa Optikey hiirellä asentoon sijasta. " },
			{ Languages.FrenchCanada.ToCultureInfo(), "Pour utiliser Optikey avec un oculomètre d'assistance, vous devez soit la nouvelle version de Tobii Windows Control, ou le moteur de suivi Tobii Eye. Si vous avez besoin d'utiliser l'ancienne version de Tobii Windows Control (Tobii Gaze Interaction), alors vous devrez contrôler Optikey utilisant la position de la souris à la place. " },
			{ Languages.FrenchFrance.ToCultureInfo(), "Pour utiliser Optikey avec un oculomètre d'assistance, vous devez soit la nouvelle version de Tobii Windows Control, ou le moteur de suivi Tobii Eye. Si vous avez besoin d'utiliser l'ancienne version de Tobii Windows Control (Tobii Gaze Interaction), alors vous devrez contrôler Optikey utilisant la position de la souris à la place. " },
			{ Languages.GeorgianGeorgia.ToCultureInfo(), "იმისათვის, რომ გამოიყენოთ Optikey ერთად Tobii დამხმარე თვალის tracker, თქვენ არც უნდა ახალი ვერსია Windows Control, ან Tobii Eye Tracking სისტემა. თუ თქვენ უნდა გამოვიყენოთ ძველი ვერსია Tobii Windows კონტროლის პროგრამა (Tobii Gaze Interaction Software), მაშინ თქვენ უნდა აკონტროლოთ Optikey მაუსის პოზიცია ნაცვლად. " },
			{ Languages.GermanGermany.ToCultureInfo(), "Um Optikey mit einem Unterstützungs-Eye-Tracker zu benutzen, brauchen Sie entweder eine neue Version von Windows Control, oder die Tobii Eye Tracking Software. Wenn Sie die alte Version der Tobii Windows Control Software benutzen müssen (einschließlich die Tobii Gaze Interaction Einstellungen), dann müssen Sie Optikey über die Mausposition steuern." },
			{ Languages.GreekGreece.ToCultureInfo(), "Για να χρησιμοποιήσετε Optikey με βοηθητικές tracker μάτι, θα πρέπει είτε τη νέα έκδοση των Windows Control, ή τον κινητήρα Tobii Eye Tracking. Εάν πρέπει να χρησιμοποιήσετε την παλιά έκδοση της εφαρμογής ελέγχου Tobii Windows Control (Tobii Gaze Interaction Software), τότε θα πρέπει να ελέγχει Optikey χρησιμοποιώντας τη θέση του ποντικιού αντ 'αυτού. " },
			{ Languages.HebrewIsrael.ToCultureInfo(), "כדי להשתמש Optikey עם גשש Tobii העין ,שאתה צריך את הגרסה החדשה של הבקרה של Tobii Windows Control, או מנוע עקיבת העין Tobii" },
			{ Languages.HindiIndia.ToCultureInfo(), "एक सहायक आई ट्रैकर के साथ Optikey का उपयोग करने के लिए, आपको या तो विंडोज कंट्रोल के नए संस्करण की आवश्यकता है, या टोबि आई ट्रैकिंग इंजन। अगर आपको Tobii विंडोज कंट्रोल एप्लिकेशन (Tobii Gaze इंटरैक्शन सेटिंग्स सहित) के पुराने संस्करण का उपयोग करने की आवश्यकता है, तो आपको माउस की स्थिति का उपयोग करके Optikey को नियंत्रित करने की आवश्यकता होगी।" },
			{ Languages.HungarianHungary.ToCultureInfo(), "Ahhoz, hogy használni Optikey egy segítő szemkövetővel, akkor sem kell az új verzió a Windows Control vagy a Tobii Eye Tracking motort. Ha kell használni a régi verziót a Tobii Windows-vezérlési alkalmazás (beleértve Tobii Gaze Interaction beállítások), akkor meg kell, hogy ellenőrizzék optikey egér segítségével összesen helyett." },
			{ Languages.ItalianItaly.ToCultureInfo(), "Per usare Optikey con un dispositivo di tracciamento oculare, hai bisogno o della nuova versione di Windows Control, oppure del software Tobii Eye Tracking. Se hai la vecchia versione del software di controllo Tobii per Windows (incluse le impostazioni Tobii Gaze Interaction), allora per usare Optikey devi impostarne il controllo via posizione del mouse." },
			{ Languages.JapaneseJapan.ToCultureInfo(), "支援アイトラッカーでOptikey使用するには、次のいずれかは、Windows Control、または Tobii アイトラッキングエンジンの新しいバージョンが必要です。あなたは（Tobii Gaze Interaction Software）、Tobii Windows Control アプリケーションの古いバージョンを使用する必要がある場合は、代わりにマウスの位置を使用してOptikey制御する必要があります。" },
			{ Languages.KoreanKorea.ToCultureInfo(), "Tobii 보조 안구 추적기와 Optikey 사용하려면,  Tobii Windows Control  윈도우 제어, 또는 Tobii 눈 추적 엔진의 새 버전이 필요합니다. 당신이 (Tobii Gaze Interaction Software) Tobii 윈도우 제어 응용 프로그램의 이전 버전을 사용해야하는 경우, 당신은 대신 마우스 위치를 사용하여 Optikey 제어해야합니다. " },
			{ Languages.PersianIran.ToCultureInfo(), "ببه منظور استفاده از این نرم افزار Optikey با ردیاب چشم Tobii، شما هم نیاز به نسخه جدید Tobii Windows Control و یا موتور Tobii ردیابی چشم. اگر شما نیاز به استفاده از نسخه های قدیمی نرم Tobii Windows Control (Tobii Gaze Interaction System)، سپس شما نیاز به کنترل Optikey با استفاده از موقعیت ماوس به جای. " },
			{ Languages.PolishPoland.ToCultureInfo(), "Aby korzystać Optikey z Tobii wspomagających eye tracker, albo trzeba nową wersję Tobii Windows Control lub silnika Tobii Eye Tracking. Jeśli musisz używać starej wersji aplikacji Tobii Windows Control (Tobii Gaze Interaction Software), a następnie trzeba będzie kontrolować Optikey użyciu pozycji myszy zamiast. " },
			{ Languages.PortuguesePortugal.ToCultureInfo(), "Para usar Optikey um gerenciador de visão assistiva, você nem precisa a nova versão do Tobii Windows Control, ou o motor Eye Tracking Tobii. Se você precisa usar a versão antiga do aplicativo de Tobii Windows Control (Tobii Gaze Interaction Software), então você vai precisar para controlar Optikey usando posição do mouse em seu lugar. Para mais informações, consulte www.optikey.org/help" },
			{ Languages.RussianRussia.ToCultureInfo(), "Для того, чтобы использовать Optikey с Tobii  реабилитационным трекером глаз, вам необходимо либо новую версия Tobii Windows Control или двигатель Tobii отслеживания глаз. Если вам нужно использовать старую версию приложения Tobii Windows Control  (Tobii Gaze Interaction Software), то вам нужно будет контролировать Optikey используя положение мыши вместо этого. " },
			{ Languages.SerbianSerbia.ToCultureInfo(), "Да бисте користили Optikey са помоћним очију трагач, ти или треба нову верзију Tobii Windows Control , или софтвер Tobii Eye Tracking. Ако морате да користите стару верзију  Tobii Windows  Control (Tobii Gaze Interaction Software), онда ћете морати да контролишете Optikey користећи позицију миша уместо тога. " },
			{ Languages.SlovakSlovakia.ToCultureInfo(), "Ak chcete používať Optikey s asistenčnou očí tracker, musíte buď novú verziu systému Windows Control, alebo motora Tobi Eye Tracking. Ak potrebujete použiť starú verziu ovládacieho programu Tobi Windows (vrátane nastavenia Tobi Gaze interakcie), potom sa budete musieť riadiť Optikey pomocou pozíciu myši miesto. " },
			{ Languages.SlovenianSlovenia.ToCultureInfo(), "Za uporabo Optikey s pomožno oči tracker, ali boste potrebovali novo različico nadzor Tobii Windows Control, ali motor Tobii sledenje oči. Če želite uporabljati staro različico aplikacije za nadzor Tobii Windows Control (Tobii Gaze Interaction Software), potem boste morali za nadzor Optikey namesto uporabe položaj miške." },
			{ Languages.SpanishSpain.ToCultureInfo(), "Para utilizar Optikey con un rastreador ocular de asistencia, ya sea que necesita la nueva versión de Tobii Windows Control, o el motor de Tobii Eye Tracking. Si es necesario utilizar la versión antigua de la aplicación Tobii Windows Control (Tobii Gaze Interaction Software), entonces necesitará para controlar Optikey utilizando la posición del ratón en lugar. " },
			{ Languages.TurkishTurkey.ToCultureInfo(), "Bir yardımcı göz izleme ile Optikey kullanmak için, ya da Tobii Windows Control veya Tobii Eye Tracking motorunun yeni sürümü gerekir. Eğer (Tobii Gaze Interaction Software) Tobii Windows Control eski bir sürümünü kullanmanız gerekiyorsa, o zaman bunun yerine fare konumunu kullanarak Optikey kontrol etmek gerekir. Daha fazla bilgi için, bkz www.optikey.org/help" },
			{ Languages.UkrainianUkraine.ToCultureInfo(), "Для того, щоб використовувати Optikey з Tobii реабілітаційним трекером очей, вам необхідно або нову версія Tobii Windows Control  або двигун Tobii відстеження очей. Якщо вам потрібно використовувати стару версію програми Tobii Windows Control  (Tobii Gaze Interaction Software), то вам потрібно буде контролювати Optikey використовуючи положення миші замість цього. " },
			{ Languages.UrduPakistan.ToCultureInfo(), "ایک معاون آنکھ ٹریکر کے ساتھ Optikey کو استعمال کرنے کے لئے، آپ کو یا تو Tobii Windows Control کے کنٹرول، یا Tobii آنکھ سے باخبر رکھنے کے انجن کا نیا ورژن کی ضرورت ہے. آپ Tobii ونڈوز کے Tobii Windows Control کی درخواست (Tobii Gaze Interaction Software) کے پرانے ورژن استعمال کرنے کے لئے کی ضرورت ہے تو، پھر آپ کو اس کی بجائے ماؤس پوزیشن کو استعمال کرتے ہوئے Optikey کو کنٹرول " },
		};
		public static Dictionary<CultureInfo, string> VI_MYGAZE_INFO = new Dictionary<CultureInfo, string>()
		{
			{ Languages.CatalanSpain.ToCultureInfo(), "La Interacció Visual myGaze només s'admet si ja ha instal·lat els controladors de client myGaze, que ja no estan disponibles per a baixar. Si no heu instal·lat aquests conductors, cal seleccionar l'ús 'posició del ratolí' en el seu lloc, i utilitzar Optikey en combinació amb l'aplicació myGaze EyeMousePlay per moure el cursor." },
			{ Languages.CroatianCroatia.ToCultureInfo(), "Vizualni Interakcija myGaze podržana je samo ako ste već instalirali myGaze klijent vozača, koji više nisu dostupna za preuzimanje. Ako nemate ove upravljački programi instalirani, trebali biste odabrati koristiti „miša poziciju”, umjesto, i koristiti Optikey u kombinaciji s myGaze EyeMousePlay prijave za pomicanje kursora." },
			{ Languages.CzechCzechRepublic.ToCultureInfo(), "Visual Interaction myGaze je podporována pouze v případě, že jste již nainstalovali klientských ovladačů myGaze, které již nejsou k dispozici ke stažení. Pokud nechcete mít nainstalovány tyto ovladače, měli byste zvolit použití ‚pozici myši‘ místo, a použití Optikey v kombinaci s aplikací myGaze EyeMousePlay pro pohyb kurzoru." },
			{ Languages.DanishDenmark.ToCultureInfo(), "Visual Interaction myGaze understøttes kun, hvis du allerede har installeret de myGaze klient drivere, som ikke længere er tilgængelig for download. Hvis du ikke har disse drivere installeret, skal du vælge anvendelse 'museposition' i stedet, og bruge Optikey i kombination med myGaze EyeMousePlay ansøgning for at flytte markøren." },
			{ Languages.DutchBelgium.ToCultureInfo(), "De Visual Interaction myGaze wordt alleen ondersteund als u reeds de myGaze client drivers, die niet meer beschikbaar zijn voor download hebt geïnstalleerd. Als u niet over deze stuurprogramma's zijn geïnstalleerd, moet u gebruik maken 'mouse positie' te selecteren in plaats daarvan, en gebruik Optikey in combinatie met de myGaze EyeMousePlay applicatie om de cursor te verplaatsen." },
			{ Languages.DutchNetherlands.ToCultureInfo(), "De Visual Interaction myGaze wordt alleen ondersteund als u reeds de myGaze client drivers, die niet meer beschikbaar zijn voor download hebt geïnstalleerd. Als u niet over deze stuurprogramma's zijn geïnstalleerd, moet u gebruik maken 'mouse positie' te selecteren in plaats daarvan, en gebruik Optikey in combinatie met de myGaze EyeMousePlay applicatie om de cursor te verplaatsen." },
			{ Languages.EnglishCanada.ToCultureInfo(), "The Visual Interaction myGaze is only supported if you've already installed the myGaze client drivers, which are no longer available for download. If you don't have these drivers installed, you should select use 'mouse position' instead, and use Optikey in combination with the myGaze EyeMousePlay application to move the cursor." },
			{ Languages.EnglishUK.ToCultureInfo(), "The Visual Interaction myGaze is only supported if you've already installed the myGaze client drivers, which are no longer available for download. If you don't have these drivers installed, you should select use 'mouse position' instead, and use Optikey in combination with the myGaze EyeMousePlay application to move the cursor." },
			{ Languages.EnglishUS.ToCultureInfo(), "The Visual Interaction myGaze is only supported if you've already installed the myGaze client drivers, which are no longer available for download. If you don't have these drivers installed, you should select use 'mouse position' instead, and use Optikey in combination with the myGaze EyeMousePlay application to move the cursor." },
			{ Languages.FinnishFinland.ToCultureInfo(), "Visual Interaction myGaze tuetaan vain, jos olet jo asentanut myGaze asiakkaan ohjaimiin, joita ei enää ladattavissa. Jos sinulla ei ole näitä ajurit on asennettu, kannattaa valita käyttöön 'hiiren sijainti' sijaan, ja käyttää Optikey yhdessä myGaze EyeMousePlay sovelluksen siirtää osoitinta." },
			{ Languages.FrenchCanada.ToCultureInfo(), "Le myGaze Visual Interaction est pris en charge uniquement si vous avez déjà installé les pilotes clients myGaze, qui ne sont plus disponibles pour téléchargement. Si vous ne disposez pas de ces pilotes installés, vous devez sélectionner l'utilisation « position de la souris » au lieu, et utiliser Optikey en combinaison avec l'application myGaze EyeMousePlay pour déplacer le curseur." },
			{ Languages.FrenchFrance.ToCultureInfo(), "Le myGaze Visual Interaction est pris en charge uniquement si vous avez déjà installé les pilotes clients myGaze, qui ne sont plus disponibles pour téléchargement. Si vous ne disposez pas de ces pilotes installés, vous devez sélectionner l'utilisation « position de la souris » au lieu, et utiliser Optikey en combinaison avec l'application myGaze EyeMousePlay pour déplacer le curseur." },
			{ Languages.GeorgianGeorgia.ToCultureInfo(), "ვიზუალური ურთიერთქმედება myGaze მხოლოდ მხარი, თუ თქვენ უკვე დაყენებული myGaze კლიენტს მძღოლები, რომლებიც აღარ ხელმისაწვდომია. თუ თქვენ არ გაქვთ ამ დრაივერები დაყენებული, თქვენ უნდა აირჩიოთ გამოყენება 'მაუსის პოზიცია' ნაცვლად და გამოიყენონ Optikey კომბინაციაში myGaze EyeMousePlay განაცხადის გადატანა კურსორი." },
			{ Languages.GermanGermany.ToCultureInfo(), "Die Visuelle Interaktion myGaze ist unterstüzt nur wenn Sie schon den myGaze Client-Treiber installiert haben, der nicht mehr zum Download verfügbar ist. Wenn Sie diesen Treiber nicht installiert haben, dann sollten Sie stattdessen den Mausposition-Modus auswählen, und Optikey in Verbindung mit der myGaze EyeMousePlay Software benutzen." },
			{ Languages.GreekGreece.ToCultureInfo(), "Η myGaze Visual Αλληλεπίδραση υποστηρίζεται μόνο αν έχετε ήδη εγκαταστήσει τα προγράμματα οδήγησης πελάτη myGaze, η οποία δεν είναι πλέον διαθέσιμο για download. Εάν δεν έχετε εγκαταστήσει αυτά τα προγράμματα οδήγησης, θα πρέπει να επιλέξετε τη χρήση «θέση του ποντικιού» αντ 'αυτού, και η χρήση Optikey σε συνδυασμό με την εφαρμογή myGaze EyeMousePlay για να μετακινήσετε το δρομέα." },
			{ Languages.HebrewIsrael.ToCultureInfo(), "MyGaze האינטראקציה החזותי נתמך רק אם כבר התקין את מנהלי הלקוח myGaze, אשר כבר אינם זמינות להורדה. אם אין לך נהגים אלה מותקנים, אתה צריך לבחור השימוש עמדת העכבר 'במקום, ולהשתמש Optikey בשילוב עם יישום myGaze EyeMousePlay כדי להזיז את הסמן." },
			{ Languages.HindiIndia.ToCultureInfo(), "यदि आपने पहले ही myGaze क्लाइंट ड्राइवर स्थापित कर लिया है, तो विजुअल इंटरेक्शन myGaze समर्थित है, जो अब डाउनलोड के लिए उपलब्ध नहीं हैं। यदि आपके पास ये ड्राइवर स्थापित नहीं हैं, तो आपको इसके बजाय 'माउस पोजिशन' का उपयोग करना चाहिए, और कर्सर ले जाने के लिए MyGaze EyeMousePlay एप्लिकेशन के साथ संयोजन में Optikey का उपयोग करना चाहिए।" },
			{ Languages.HungarianHungary.ToCultureInfo(), "A Visual Interaction myGaze csak akkor támogatott, ha már telepítve van a myGaze kliens illesztőprogramokat, amelyek már nem tölthető le. Ha nem rendelkezik a fenti illesztőprogramok telepítve, akkor válassza ki use egér pozíció \"helyett, és használat optikey kombinálva myGaze EyeMousePlay alkalmazás mozgatni a kurzort." },
			{ Languages.ItalianItaly.ToCultureInfo(), "La Visual Interaction myGaze è disponibile soltanto se hai già installato i driver per il client myGaze, che non sono più disonibili per il download. Se non hai già installato questi driver, dovrai selezionare la modalità di utilizzo con la posizione del mouse e usare Optikey in combinazione con l'applicazione myGaze EyeMousePlay per muovere il cursore." },
			{ Languages.JapaneseJapan.ToCultureInfo(), "あなたは既に、もはやダウンロードできますmyGazeクライアントドライバをインストールした場合のVisual対話myGazeのみがサポートされています。あなたはこれらのドライバがインストールされていない場合は、代わりに使用「マウスの位置」を選択して、カーソルを移動しmyGaze EyeMousePlayアプリケーションとの組み合わせでOptikey使用する必要があります。" },
			{ Languages.KoreanKorea.ToCultureInfo(), "이미 더 이상 다운로드 할 수있는 myGaze 클라이언트 드라이버를 설치 한 경우 시각적 상호 작용 myGaze에만 지원됩니다. 당신이이 드라이버가 설치되어 있지 않은 경우, 당신은 대신 사용 '마우스 위치'를 선택하고 커서를 이동 myGaze EyeMousePlay 응용 프로그램과 함께 Optikey 사용해야합니다." },
			{ Languages.PersianIran.ToCultureInfo(), "myGaze تعامل ویژوال تنها پشتیبانی اگر شما در حال حاضر نصب درایور مشتری myGaze، که دیگر برای دانلود موجود است. اگر شما لازم نیست که این درایور نصب شده است، شما باید با استفاده از 'موقعیت ماوس'' را انتخاب کنید به جای آن، و استفاده از Optikey در ترکیب با نرم افزار myGaze EyeMousePlay به حرکت مکان نما." },
			{ Languages.PolishPoland.ToCultureInfo(), "Visual Interaction myGaze jest obsługiwana tylko wtedy, gdy masz już zainstalowane sterowniki klienckie myGaze, które nie są już dostępne do pobrania. Jeśli nie masz zainstalowane te sterowniki, należy wybrać pozycję myszy użyć „” zamiast, i używać Optikey w połączeniu z aplikacją myGaze EyeMousePlay aby przesunąć kursor." },
			{ Languages.PortuguesePortugal.ToCultureInfo(), "O Interaction myGaze Visual é suportado apenas se você já tiver instalado os drivers cliente myGaze, que já não estão disponíveis para download. Se você não tem esses drivers instalados, você deve selecionar o uso 'posição do mouse' em vez, e usar Optikey em combinação com a aplicação myGaze EyeMousePlay para mover o cursor." },
			{ Languages.RussianRussia.ToCultureInfo(), "Визуальное взаимодействие myGaze поддерживается только, если вы уже установили клиентские драйверы myGaze, которые больше не доступны для скачивания. Если вы не установили эти драйвера, вы должны выбрать использовать «положение мыши» вместо этого, и использовать Optikey в сочетании с приложением myGaze EyeMousePlay для перемещения курсора." },
			{ Languages.SerbianSerbia.ToCultureInfo(), "Висуал Интеракција миГазе је подржан само ако сте већ инсталирали клијент драјвере миГазе, које више нису доступни за преузимање. Ако немате те возачи инсталиран, треба да одаберете користити 'позицију миша' уместо тога, и користити Optikey у комбинацији са применом миГазе ЕиеМоусеПлаи за померање курсора." },
			{ Languages.SlovakSlovakia.ToCultureInfo(), "Visual Interaction myGaze je podporovaná len v prípade, že ste už nainštalovali klientskych ovládačov myGaze, ktoré už nie sú k dispozícii na stiahnutie. Ak nechcete mať nainštalované tieto ovládače, mali by ste zvoliť použitia, pozíciu myši 'miesto, a použitie Optikey v kombinácii s aplikáciou myGaze EyeMousePlay pre pohyb kurzora." },
			{ Languages.SlovenianSlovenia.ToCultureInfo(), "Visual Interaction myGaze je podprta le, če ste že namestili gonilnike strank myGaze, ki niso več na voljo za prenos. Če nimate nameščene ti vozniki, morate izbrati uporaba 'položaj miške' namesto, in uporabo Optikey v kombinaciji z uporabo myGaze EyeMousePlay premakniti kazalec." },
			{ Languages.SpanishSpain.ToCultureInfo(), "La Interacción Visual myGaze sólo se admite si ya ha instalado los controladores de cliente myGaze, que ya no están disponibles para su descarga. Si no ha instalado estos conductores, hay que seleccionar el uso 'posición del ratón' en su lugar, y utilizar Optikey en combinación con la aplicación myGaze EyeMousePlay para mover el cursor." },
			{ Languages.TurkishTurkey.ToCultureInfo(), "Zaten artık indirilebilir myGaze istemci sürücüleri, yükledim eğer Görsel Etkileşim myGaze desteklenir. Eğer bu sürücülerin yüklü olmayan, bunun yerine kullanılması 'fare konumunu' seçin ve imleci hareket ettirmek için myGaze EyeMousePlay uygulaması ile birlikte Optikey kullanmalıdır." },
			{ Languages.UkrainianUkraine.ToCultureInfo(), "Візуальне взаємодія myGaze підтримується тільки, якщо ви вже встановили клієнтські драйвери myGaze, які більше не доступні для скачування. Якщо ви не встановили ці драйвера, ви повинні вибрати використовувати «положення миші» замість цього, і використовувати Optikey в поєднанні з додатком myGaze EyeMousePlay для переміщення курсора." },
			{ Languages.UrduPakistan.ToCultureInfo(), "آپ نے پہلے ہی myGaze کلائنٹ ڈرائیوروں، جس میں اب کوئی ڈاؤن لوڈ کے لئے دستیاب ہیں نصب ہے تو بصری تعامل myGaze صرف حمایت کی ہے. اگر آپ ان کے ڈرائیوروں نصب نہیں ہے تو، آپ کو استعمال کے 'ماؤس پوزیشن' کو منتخب کرنا چاہئے بجائے، اور کرسر کو منتقل کرنے myGaze EyeMousePlay درخواست کے ساتھ مجموعہ میں Optikey استعمال کرتے ہیں." },
		};
	}
}
